import React from 'react';
import { Link } from 'react-router-dom';

const TopHeader = () => {
    return (
        <header className="bg-gray-800 text-white shadow-md">
            <div className="container mx-auto px-4 py-3 flex justify-between items-center">
                <h1 className="text-xl font-bold">Plutina</h1>
                <nav className="space-x-4">
                    <Link to="/" className="hover:text-yellow-400">Accueil</Link>
                    <Link to="/produits" className="hover:text-yellow-400">Produits</Link>
                    <Link to="/commandes" className="hover:text-yellow-400">Commandes</Link>
                    <Link to="/devis" className="hover:text-yellow-400">Devis</Link>
                    <Link to="/factures" className="hover:text-yellow-400">Factures</Link>
                </nav>
            </div>
        </header>
    );
};

export default TopHeader;
